// --- fm.Source..Eq
inline bool fm::Source_Eq(fm::Source& lhs, fm::Source& rhs) {
    bool retval = true;
    retval = retval
    &&*(u64*)(lhs.ch+0) == *(u64*)(rhs.ch+0)
    &&*(u64*)(lhs.ch+8) == *(u64*)(rhs.ch+8)
    &&*(u64*)(lhs.ch+16) == *(u64*)(rhs.ch+16)
    &&*(u64*)(lhs.ch+24) == *(u64*)(rhs.ch+24);
    return retval;
}

